import "./App.css";
import Dashboard from "./components/Dashboard";
import Header from "./components/Header";

function App() {
  let hell = {
    id: 1,
    name: "hallu",
  };
  return (
    <div className="App">
      <Header />
      <Dashboard name={hell} />
    </div>
  );
}

export default App;
